import React from "react";
import Timeline from "@material-ui/lab/Timeline";
import TimelineItem from "@material-ui/lab/TimelineItem";
import TimelineSeparator from "@material-ui/lab/TimelineSeparator";
import TimelineConnector from "@material-ui/lab/TimelineConnector";
import TimelineContent from "@material-ui/lab/TimelineContent";
import TimelineDot from "@material-ui/lab/TimelineDot";
import TimelineOppositeContent from "@material-ui/lab/TimelineOppositeContent";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import ImgSiSC from "../../../images/sisc.jpeg";
import ImgFacultate from "../../../images/ase.jpeg";
import ImgLiceu from "../../../images/cnvs.jpeg";


const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 345
  },
  media: {
    height: 0,
    paddingTop: "56.25%" // 16:9
  },
}));

export default function Experiences() {
  const classes = useStyles();


  return (
    <React.Fragment>
      <Timeline align="alternate">
      <TimelineItem>
          <TimelineOppositeContent>
            <Typography color="textSecondary">2019-present</Typography>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot color="teal" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
          <Card className={classes.root}>
      <CardHeader
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
      <img className="media" src={ImgSiSC} alt="sisc" />
    </Card>
          </TimelineContent>
        </TimelineItem>

        <br></br>
        <br></br>

        <TimelineItem>
          <TimelineOppositeContent>
            <Typography color="textSecondary">2019-present</Typography>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot color="teal" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
          <Card className={classes.root}>
      <CardHeader
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
      <img className="media" src={ImgFacultate} alt="ase" />
    </Card>
          </TimelineContent>
        </TimelineItem>
        <br></br>
        <br></br>


        <TimelineItem>
          <TimelineOppositeContent>
            <Typography color="textSecondary">2015-2019</Typography>
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot color="teal" />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
          <Card className={classes.root}>
      <CardHeader
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
      <img className="media" src={ImgLiceu} alt="cnvs" />
    </Card>
          </TimelineContent>
        </TimelineItem>
      </Timeline>
    </React.Fragment>
  );
}
